css:
@-moz-document domain("canijailbreak.com") {
body {
    background-color:#222;
    color:#ddd
}
h1, h2, h3, h4, h5, h6, .h1, .h2, .h3, .h4, .h5, .h6{
    color: #fff;
}
a:hover, a:focus{
    color: #61adf9;
}
a{
    color: #54abf9;
}

img[alt="Just a Penguin"]{
    filter: invert(10%);
}
.btn-info{
    background-color: #666;
}
.btn-info:hover{
    background-color: #777;
}
.well{
    background-color: #262626;
    height: 340px;
}

.text-success {
    color: #67bb6a;
}
.text-warning {
    color: #ffb03b;
}
.text-danger {
    color: #ec6065;
}
}
